import React from "react";
import css from "@emotion/css";
import { COLORS } from "../../../constants";

const LeftInfo = ({ isProfileData }) => {
  const pData = isProfileData && isProfileData.profile;
  console.log(pData);

  return (
    <React.Fragment>
      <div className="block">
        <div
          className="text-sm font-sans"
          css={css`
            & > p {
              display: block;
              margin-right: 10px;
            }
            & > p > span {
              float: left;
              width: 48%;
              border-bottom: 1px solid ${COLORS.GRAY_LIGHTER};
              padding: 5px 0px;
            }
          `}
        >
          {pData &&
            pData.length > 0 &&
            pData.map((item) => (
              <p key={item} className="clearfix">
                <span>Name </span>
                <span>{item.firstName}</span>
                <span>First Name </span>
                <span>-</span>
                <span>Last Name </span>
                <span>{item.lastName}</span>
                <span>Gender </span>
                <span>{item.gender}</span>
                <span>Date of Birth </span>
                <span>{item.dateOfBirth}</span>
              </p>
            ))}
        </div>
      </div>
    </React.Fragment>
  );
};

export default LeftInfo;
